
SELECT MIN("train"."item_nbr") as agg_0 FROM "key" LEFT OUTER JOIN "station" ON "key"."station_nbr" = "station"."station_nbr" LEFT OUTER JOIN "train" ON "key"."store_nbr" = "train"."store_nbr"  WHERE "station"."station_nbr" BETWEEN 10 AND 14 AND ("train"."date" = '%2014-02-21%' OR ("train"."date" IN ('2012-08-29', '2013-02-21', '2013-02-15', '2013-02-26', '2012-12-26', '2012-09-06', '2012-06-04', '2012-07-16') AND "train"."date" IN ('2013-02-26', '2012-10-05', '2012-07-27', '2013-02-21', '2012-09-06'))) AND "key"."store_nbr" >= 34;